commit_message:
[api versions]Support to specify api versions in the spec of env

Spec example:
  Specify cinder client version

  {
      "openstack": {
          "auth_url": "http://example.net:5000/v2.0/",
          "region_name": "RegionOne",
          "endpoint_type": "public",
          "admin": {
              "username": "admin",
              "password": "myadminpass",
              "tenant_name": "demo"
          },
          "https_insecure": false,
          "https_cacert": ""
          "api_info": {
              "cinder": {
                  "version": "1",
                  "service_type": "volume"
              }
          }
      }
  }

Change-Id: I74578e3b1c4e7b662ba66955ef9fb62cd4eeb788

Add DictionaryField class to resource base

Add `DictionaryField` class capable of handling dictionaries in
resource body JSON.
This is necessary to be able to parse resources like Message
Registry:
"Messages": {
        "Success": {
            "Message": "Completed successfully",
            "Severity": "OK",
            [...]
        },
        "Failure": {
            "Message": "Failed",
            "Severity": "Critical",
            [...]
        }
}

